import styled from 'styled-components';

export const StyledContent = styled.div`
    margin: auto;
    margin-top: 45px;
    display: flex;
    justify-content: space-between;
    flex-direction: column;
    align-items: center;
`; 

export const StyledTitles = styled.div`
    display: block;
    justify-content: space-around;
    margin: 10px 20px;
    padding: 0 25px;
`;
